const FFfooter = () => {
  return (
    <>
      <footer className="py-2">
        <div className="row">
          <div className="col-6 col-md-2 mb-3">
            <h5>Section</h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Home</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Features</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Pricing</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">FAQs</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">About</a></li>
            </ul>
          </div>
    
          <div className="col-6 col-md-2 mb-3">
            <h5>Services</h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Home</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Features</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Pricing</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">FAQs</a></li>
            </ul>
          </div>
    
          <div className="col-6 col-md-2 mb-3">
            <h5>Contacts</h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Home</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Features</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 text-body-secondary">Pricing</a></li>
            </ul>
          </div>
    
          <div className="col-md-5 offset-md-1 mb-3">
            <form>
              <h3>Give Feedback to our Mail</h3>
              <p>Monthly digest of what's new and exciting from us.</p>
              <div className="d-flex flex-column flex-sm-row w-100 gap-2">
                <label for="newsletter1" className="visually-hidden">Email address</label>
                <input id="newsletter1" type="text" className="form-control" placeholder="Email address"/>
                <button className="btn btn-outline-warning" type="button">Subscribe</button>
              </div>
            </form>
          </div>
        </div>
    
        <div className="parent-list d-flex flex-column  justify-content-center align-items-center py-4 my-0 border-top">
         <p> <strong>Anime<span style={{color: "orange;"}}>Tank</span>
         </strong>Â© 2023 Company, Inc. All rights reserved.</p>
          <ul className="d-flex justify-content-center align-item-center list-unstyled px-5 my-0">
            <li className="ms-3"><a className="link-body-emphasis" href="/">
            <i className="fa-brands fa-twitter fa-lg" style={{color: "#0a0a0a;"}}></i></a></li>
            <li className="ms-3"><a className="link-body-emphasis" href="/">
            <i className="fa-brands fa-facebook fa-lg" style={{color: "#0a0a0a;"}}></i></a></li>
            <li className="ms-3"><a className="link-body-emphasis" href="/">
            <i className="fa-brands fa-instagram fa-lg" style={{color: "#0a0a0a;"}}></i></a></li>
          </ul>
        </div>
      </footer>
 

    </>
  )
}

export default FFfooter;
